"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H3475172\">",
"      <span class=\"h1\">",
"       What is a chalazion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A chalazion is a painless lump in the eyelid. It is caused by a blockage in a gland that makes tears.",
"     </p>",
"     <p>",
"      A chalazion is different from a &ldquo;stye,&rdquo; which also causes a lump on the eyelid. But a stye is caused by an infection and is painful. A chalazion is not tender or painful, but it often lasts longer than a stye does. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3475187\">",
"      <span class=\"h1\">",
"       What are the symptoms of a chalazion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A chalazion often begins with redness and swelling. Then, a firm, painless lump forms, usually in the upper eyelid. The lump can be as large as a pea. If a chalazion forms in the lower eyelid, it looks like a yellow-white bump (",
"      <a class=\"graphic graphic_picture graphicRef83659 \" href=\"UTD.htm?19/22/19811\">",
"       picture 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3475202\">",
"      <span class=\"h1\">",
"       Is there a test for a chalazion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. But your doctor or nurse should be able to tell if you have a chalazion by doing an exam and talking with you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3475217\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to treat this?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can put warm, wet pressure on the chalazion. Wet a clean wash cloth with warm water and put it over your chalazion. When the wash cloth cools, reheat it with warm water and put it back over the chalazion. Repeat these steps for 15 minutes, 4 times a day.",
"     </p>",
"     <p>",
"      You should NOT squeeze or pop your chalazion.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3475232\">",
"      <span class=\"h1\">",
"       How is chalazion treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most of the time, a chalazion goes away with the treatment described above within a few weeks. It might even go away on its own. But if you have a large chalazion that does not go away or keeps coming back, your doctor might refer you to an eye doctor. He or she can do a procedure in the office to remove the chalazion or inject a medicine into the chalazion to reduce the swelling. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3475247\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
