var title_f17_56_18317="Therapies for castrate resistant prostate cancer";
var content_f17_56_18317=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F85716&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F85716&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Therapies for castrate resistant prostate cancer (CRPC)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"8\" width=\"12%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Approach",
"       </td>",
"       <td class=\"subtitle1\">",
"        Indications, regulatory status",
"       </td>",
"       <td class=\"subtitle1\">",
"        Route, schedule",
"       </td>",
"       <td class=\"subtitle1\">",
"        Steroids",
"       </td>",
"       <td class=\"subtitle1\">",
"        Symptoms, disease burden",
"       </td>",
"       <td class=\"subtitle1\">",
"        Contraindications",
"       </td>",
"       <td class=\"subtitle1\">",
"        PSA response to treatment",
"       </td>",
"       <td class=\"subtitle1\">",
"        Median overall survival benefit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abiraterone",
"       </td>",
"       <td>",
"        Approved, metastatic CRPC",
"       </td>",
"       <td>",
"        Oral, daily",
"       </td>",
"       <td>",
"        Required",
"       </td>",
"       <td class=\"centered\">",
"        -",
"       </td>",
"       <td>",
"        Severe liver dysfunction; hypokalemia; heart failure",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        <p>",
"         Post docetaxel:&nbsp;4.6 mos.",
"         <sup>",
"          [1]",
"         </sup>",
"        </p>",
"        Chemotherapy naive:*",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Enzalutamide",
"       </td>",
"       <td>",
"        Approved/post docetaxel",
"       </td>",
"       <td>",
"        Oral, daily",
"       </td>",
"       <td>",
"        Not required",
"       </td>",
"       <td class=\"centered\">",
"        -",
"       </td>",
"       <td>",
"        Seizures",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        4.8 mos.",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sipuleucel-T",
"       </td>",
"       <td>",
"        Approved, pre/post docetaxel",
"       </td>",
"       <td>",
"        IV, every 2 weeks x 3 doses",
"       </td>",
"       <td>",
"        <p>",
"         Possibly",
"        </p>",
"        <p>",
"         contraindicated",
"        </p>",
"       </td>",
"       <td>",
"        Asymptomatic or minimally symptomatic",
"       </td>",
"       <td>",
"        Steroids; narcotics for cancer-related pain; GM-CSF; liver metastases",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        4.1 mos.",
"        <sup>",
"         [4]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Docetaxel",
"       </td>",
"       <td>",
"        Approved, metastatic CRPC",
"       </td>",
"       <td>",
"        IV, every 3 weeks",
"       </td>",
"       <td>",
"        Required",
"       </td>",
"       <td class=\"centered\">",
"        -",
"       </td>",
"       <td>",
"        Moderate liver dysfunction; cytopenias",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        2.5 mos.",
"        <sup>",
"         [5]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cabazitaxel",
"       </td>",
"       <td>",
"        Post docetaxel",
"       </td>",
"       <td>",
"        IV, every 3 weeks",
"       </td>",
"       <td>",
"        Required",
"       </td>",
"       <td class=\"centered\">",
"        -",
"       </td>",
"       <td>",
"        Moderate liver dysfunction; cytopenias",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        2.4 mos.",
"        <sup>",
"         [6]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radium-223",
"       </td>",
"       <td>",
"        Pending, post docetaxel or docetaxel ineligible",
"       </td>",
"       <td>",
"        IV, every 4 weeks",
"       </td>",
"       <td>",
"        Not required",
"       </td>",
"       <td>",
"        Symptomatic bone metastases",
"       </td>",
"       <td>",
"        Visceral metastases",
"       </td>",
"       <td>",
"        Not reported",
"       </td>",
"       <td>",
"        3.6 mos.",
"        <sup>",
"         [7]",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Median survival not reached for abiraterone; hazard ratio 0.75.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Fizazi K, Scher HI, Molina A, et al. Abiraterone acetate for treatment of metastatic castration-resistant prostate cancer: final overall survival analysis of the COU-AA-301 randomised, double-blind, placebo-controlled phase 3 study. Lancet Oncol 2012; 13: 983.",
"       </li>",
"       <li>",
"        Ryan CJ, Smith MR, de Bono JS, et al. Abiraterone in metastatic prostate cancer without previous chemotherapy. N Engl J Med 2013; 368:138.",
"       </li>",
"       <li>",
"        Scher HI, Fizazi K, Saad F, et al. Increased survival with enzalutamide in prostate cancer after chemotherapy. N Engl J Med 2012; 367:1187.",
"       </li>",
"       <li>",
"        Kantoff PW, Higano CS, Shore ND, et al. Sipuleucel-T immunotherapy for castration-resistant prostate cancer. N Engl J Med 2010; 363:411.",
"       </li>",
"       <li>",
"        Berthold DR, Pond GR, Soban F, et al. Docetaxel plus prednisone or mitoxantrone plus prednisone for advanced prostate cancer: updated survival in the TAX 327 study. J Clin Oncol 2008; 26:242.",
"       </li>",
"       <li>",
"        de Bono JS, Oudard S, Ozguroglu M, et al. Prednisone plus cabazitaxel or mitoxantrone for metastatic castration-resistant prostate cancer progressing after docetaxel treatment: a randomised open-label trial. Lancet 2010; 376:1147.",
"       </li>",
"       <li>",
"        Parker C, Nilsson S, Heinrich D, et al. Updated analysis of the phase III, double-blind, randomized, multinational study of radium-223 chloride in castration-resistant prostate cancer (CRPC) patients with bone metastases (ALSYMPCA). J Clin Oncol 30, 2012 (suppl; abst LBA4512).",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
